import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import '../styles/NotesPage.css';

function NotesPage() {
    const navigate = useNavigate();
    const [notes, setNotes] = useState([]);
    const [newNote, setNewNote] = useState('');
    const [user, setUser] = useState({});

    const fetchUser = async () => {
        const token = localStorage.getItem('token');
        if (!token) {
            navigate('/');  // Nếu không có token, điều hướng về trang đăng nhập
            return;
        }

        try {
            const res = await axios.get('http://localhost:5000/api/auth/me', {
                headers: { Authorization: `Bearer ${token}` },
            });
            setUser(res.data);
        } catch (err) {
            console.error('Failed to fetch user:', err);
            navigate('/');  // Điều hướng về trang đăng nhập nếu có lỗi
        }
    };

    const fetchNotes = async () => {
        const token = localStorage.getItem('token');
        try {
            const res = await axios.get('http://localhost:5000/api/notes', {
                headers: { Authorization: `Bearer ${token}` },
            });
            setNotes(res.data);
        } catch (err) {
            console.error('Failed to fetch notes:', err);
        }
    };

    const handleAddNote = async () => {
        const token = localStorage.getItem('token');
        if (!newNote.trim()) return;
        try {
            await axios.post('http://localhost:5000/api/notes', { content: newNote }, {
                headers: { Authorization: `Bearer ${token}` },
            });
            setNewNote('');
            fetchNotes();
        } catch (err) {
            console.error('Failed to add note:', err);
        }
    };

    const handleLogout = () => {
        localStorage.removeItem('token');
        localStorage.removeItem('username');
        navigate('/');
    };

    useEffect(() => {
        fetchUser();
        fetchNotes();
    }, []);

    return (
        <div className="home-notes-container">
            <aside className="sidebar">
                <header className="user-header">
                    <div className="user-info">
                        <img 
                            src={user.avatar || "https://via.placeholder.com/40"} 
                            alt="User Avatar" 
                            className="user-avatar" 
                        />
                        <span className="user-name">{user?.name || "User"}</span>
                    </div>
                </header>
                <h3>Teamspaces</h3>
                <ul>
                    <li>Home</li>
                    <li>Blog</li>
                    <li>List notes</li>
                    <li>..</li>
                    <li>..</li>
                </ul>
                <button className="invite-btn">Invite members</button>
                <button className="logout-btn" onClick={handleLogout}>Đăng xuất</button>
            </aside>

            <main className="main-content">
                <header className="header">
                    <h2>Good afternoon, {user?.name || "User"}</h2>
                    <input type="text" placeholder="Search or find anything..." />
                </header>

                <section className="note-input">
                    <textarea
                        placeholder="Viết ghi chú mới..."
                        value={newNote}
                        onChange={(e) => setNewNote(e.target.value)}
                    />
                    <button className="add-btn" onClick={handleAddNote}>+ Thêm ghi chú</button>
                </section>

                <section className="recent-notes">
                    <h3>Ghi chú gần đây</h3>
                    <div className="notes-grid">
                        {notes.map(note => (
                            <div key={note.id} className="note-card">
                                {note.content}
                            </div>
                        ))}
                    </div>
                </section>
            </main>
        </div>
    );
}

export default NotesPage;
